import React, { useState, useEffect } from 'react';
import axios from 'axios';
import {
  Table,
  Tabs,
  Tab,
  Container,
  Row,
  Col,
  Card,
  Badge
} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

const DataDisplay = () => {
  const [uccData, setUccData] = useState([]);
  const [orderData, setOrderData] = useState([]);
  const [activeTab, setActiveTab] = useState('ucc');
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        setLoading(true);
        const [uccResponse, orderResponse] = await Promise.all([
          axios.get('/api/ucc-registrations'),
          axios.get('/api/orders')
        ]);
        setUccData(uccResponse.data);
        setOrderData(orderResponse.data);
        setError(null);
      } catch (err) {
        setError('Error fetching data. Please try again later.');
        console.error('Error:', err);
      } finally {
        setLoading(false);
      }
    };

    fetchData();
    // Refresh data every 30 seconds
    const interval = setInterval(fetchData, 30000);
    return () => clearInterval(interval);
  }, []);

  const renderUccTable = () => (
    <Table striped bordered hover responsive>
      <thead>
        <tr>
          <th>Client Code</th>
          <th>Name</th>
          <th>Email</th>
          <th>Mobile</th>
          <th>Status</th>
          <th>Created At</th>
        </tr>
      </thead>
      <tbody>
        {uccData.map((ucc) => (
          <tr key={ucc.clientCode}>
            <td>{ucc.clientCode}</td>
            <td>{`${ucc.firstName} ${ucc.middleName || ''} ${ucc.lastName}`}</td>
            <td>{ucc.email}</td>
            <td>{ucc.mobileNo}</td>
            <td>
              <Badge bg={ucc.status === 'completed' ? 'success' : 'warning'}>
                {ucc.status}
              </Badge>
            </td>
            <td>{new Date(ucc.createdAt).toLocaleString()}</td>
          </tr>
        ))}
      </tbody>
    </Table>
  );

  const renderOrderTable = () => (
    <Table striped bordered hover responsive>
      <thead>
        <tr>
          <th>Order Ref</th>
          <th>Client Code</th>
          <th>Scheme Code</th>
          <th>Type</th>
          <th>Amount</th>
          <th>Status</th>
          <th>Created At</th>
        </tr>
      </thead>
      <tbody>
        {orderData.map((order) => (
          <tr key={order.orderRefNumber}>
            <td>{order.orderRefNumber}</td>
            <td>{order.clientCode}</td>
            <td>{order.schemeCode}</td>
            <td>{order.trxnType}</td>
            <td>{order.orderAmount}</td>
            <td>
              <Badge bg={order.status === 'completed' ? 'success' : 'warning'}>
                {order.status}
              </Badge>
            </td>
            <td>{new Date(order.createdAt).toLocaleString()}</td>
          </tr>
        ))}
      </tbody>
    </Table>
  );

  if (loading) {
    return (
      <Container className="mt-4">
        <Card>
          <Card.Body>Loading data...</Card.Body>
        </Card>
      </Container>
    );
  }

  if (error) {
    return (
      <Container className="mt-4">
        <Card>
          <Card.Body className="text-danger">{error}</Card.Body>
        </Card>
      </Container>
    );
  }

  return (
    <Container className="mt-4">
      <Row>
        <Col>
          <Card>
            <Card.Body>
              <Tabs
                activeKey={activeTab}
                onSelect={(k) => setActiveTab(k)}
                className="mb-3"
              >
                <Tab eventKey="ucc" title="UCC Registrations">
                  {renderUccTable()}
                </Tab>
                <Tab eventKey="orders" title="Orders">
                  {renderOrderTable()}
                </Tab>
              </Tabs>
            </Card.Body>
          </Card>
        </Col>
      </Row>
    </Container>
  );
};

export default DataDisplay;
